    data: |
      SELECT DISTINCT - col2 / - - ( + col1 ) + - col2 * col2 * col0 + - 91 AS col0 FROM tab2 (FORMAT parquet);
  - name: tab2

outputs:
  - name: q9332.out
    data: |
      -102491
      -24425
      -252391
